import React from 'react';
import { Route, Routes } from 'react-router-dom';
import routes from './router.json'

// Import the components from their files
import Home from '../pages/Home';
import Signin from '../pages/Signin';
import Signup from '../pages/Signup';

// Map the component strings to the actual components
const componentMapping = {
  Home,
  Signin,
  Signup
};

const RoutesConfig = () => (
    <Routes>
        {routes.map((route, index) => {
            const Component = componentMapping[route.component];
            return (
                <Route key={index} path={route.path} element={<Component />} />
            );
        })}
        <Route
            key={route.path}
            path={route.path}
            exact={route.exact}
            render={(props) => (
                <route.component {...props}>
                    {route.routes &&
                        route.routes.map((subRoute) => renderRoutes(subRoute))}
                </route.component>
            )}
        />
        );
    </Routes>
);

export default RoutesConfig;
